import React, { Component } from 'react';


class FlimDetails extends Component {
	render() {
		return (
			<>
				<div>
					<h4> {this.props.id}</h4>
					<h4> {this.props.title}</h4>
					<h4> {this.props.poster_path}</h4>
					<h4> {this.props.backdrop_path}</h4>
					<h4> {this.props.overview}</h4>
					<h4> {this.props.release_date}</h4>

				</div>
			</>
		);
	}
}

export default FlimDetails;
